import React from 'react';
import { TouchableOpacity, Text, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native'; // Assuming you are using React Navigation

export default function CartIcon({ onPress }) {
  const navigation = useNavigation();

  const toggleCartIcon = () => {
    navigation.navigate('CartIcon');
  };

  return (
    <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Icon name="arrow-left" size={24} color="black" />
      </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
  cartIconContainer: {
    position: 'absolute',
    top: 20,
    left: 20, // Adjust the position to your preference
    backgroundColor: 'transparent',
  },
  cartIcon: {
    fontSize: 24,
  },
});
